description:
Chords and Scales let you explore chords, scales, and chord progressions and compose songs intuitively and interactively. It is helpful for musicians, from beginners to experts, and allows you to understand musical structures and find inspiration.

All chords and scales can be played ascending, descending, and harmonically and are shown on virtual piano and staff. The root note and inversion of the chords can easily be changed. App also includes a song composer that allows you to easily layout chord progressions and recommends chords based on selected scales.

-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-

Features

Large chord collection;
Large scale collection;
Chord progressions collection;
Song composer with chord recommendations
Audio playback support for everything;
Piano view for chords and scales
Staff View for chords and scales
Find chords by the root and inversion, notes on the staff or piano keys;
Find scales by the root or piano keys;
Interactive circle of fifths;
MIDI in and out support;
Scale fingerings for both hands.
Simple and intuitive.

-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-

User Reviews

I'm a piano teacher of 15 years and have more and more students who want to play chords and improvise. This app is a perfect resource for them. I like it because it's thorough but, at the same time, straightforward.

I am new to piano and familiar with some scales and chord progressions, but this app will help me to understand and explore various combinations. I pair this app with additional learning material online to help me fully understand the math/science behind music.

This app is excellent for understanding scales, chords, chord progressions, and the circle of fifths. I like the easy-to-use interface. It only includes standard scales and chords. I have another app with many complicated and confusing scales that I've never heard of, much less can pronounce. I just wanted something to show me the standard scales and chords, which this app does. It also sounds like a chord or scale.

It gives you so much when you’re stuck composing. I’m relatively new to music theory, and this makes everything I’ve been learning about chords super clear.

I have taught piano for 33 years. This is the best app for any level of the student. It is so easy to use; kids love it when I use the iPad in their lessons.

